import { GET_VIDEOGAMES } from "../type/types";

const initialState = {
  allVidegames: [],
  allGamesOrigin: [],
};

const reducer = (state = initialState, action) => {
  switch (action.type) {
    case GET_VIDEOGAMES:
      return {
        ...state,
        allVidegames: action.payload,
        allGamesOrigin: action.payload,
      };
  }
};

export default reducer;
